import React from 'react';


class Resfut extends React.Component {
    setStyle = () => {
        return {
            color: this.props.color

        }
    }
    render() {
        return (
            <>
                <span>Color: {this.props.color}-Frontsize: </span>
                <div className="content" style={this.setStyle()}>content</div>
            </>
        );
    }

}

export default Resfut;
